import React from "react";
import DashboardPage from "./DashboardPage.js";

const CategoryPage = () => {
  return (
    <DashboardPage>
      <div className="container-fluid">
        <div className="row">
          <div className="col-md-9">
            <h1>Category Page</h1>
          </div>
        </div>
      </div>
    </DashboardPage>
  );
};

export default CategoryPage;
